import React, { Component } from "react";
import { connect } from "react-redux";
import { fetchSport } from "../actions/Actions";
import DetailStructure from "../components/DetailStructure";
// import { Button } from "react-bootstrap";
// import { sports } from "../utils/Schemas";
// import { sportForm } from "../utils/Forms";

class SportContainer extends Component {
  state = {
    name: "sport",
  };

  componentDidMount() {
    let id = this.props.match.params.id
    this.props.dispatch(fetchSport(id));
  }

  render() {
    return (
      <>
        <DetailStructure
          object={this.props.selected}
        //   status={this.props.status}
        //   showObjects={this.showObjects}
        //   tableHeaders={this.state.tableHeaders}
        //   name={this.state.name}
        //   plural={this.state.plural}
        //   formHelpers={sports}
        //   form={sportForm}
        //   postObject={(values) => this.props.dispatch(postSport(values))}
        />
      </>
    );
  }
}

SportContainer.propTypes = {};

function mapStateToProps(state) {
  const { selected, status, error } = state;
  return { selected, status, error };
}

export default connect(mapStateToProps)(SportContainer);
